import React from "react";
import "./App.scss";
import Sidebar from "./conponents/sidbar/sidebar";
import Chat from "./conponents/chat/Chat";
import { useSelector } from "react-redux";

function App() {
  const user = useSelector((state) => state.state.user);

  return (
    <div className="App">
      {/* Sideba */}
      <Sidebar />
      {/* chat */}
      <Chat />
    </div>
  );
}

export default App;
